import React from "react";
import "./App.css";

const Header = () => {
  return (
    <header className="header">
      <div className="logo">ironic</div>
      <nav className="nav">
        <a href="#home">Home</a>
        <a href="#about">About</a>
        <a href="#features">Features</a>
        <a href="#roadmap">Roadmap</a>
        <a href="#faq">FAQ</a>
        <a href="#insights">Insights</a>
      </nav>
      <button className="primary-btn">Try it now</button>
    </header>
  );
};

const Hero = () => {
  return (
    <section className="hero" id="home">
      <div className="hero-content">
        <h1 className="hero-title">A new smart blockchain</h1>
        <p className="hero-subtitle">Smart investments backed by real products</p>

        <div className="hero-actions">
          <button className="secondary-btn">Whitepaper</button>
          <button className="accent-btn">Purchase token</button>
        </div>

        <div className="cta">
          <button className="cta-btn">Get started</button>
          <button className="ghost-btn">Learn more</button>
        </div>
      </div>

      <div className="hero-visual">
        <div className="ring ring-1"></div>
        <div className="ring ring-2"></div>
        <div className="ring ring-3"></div>
        <div className="grid"></div>
      </div>
    </section>
  );
};

const Footer = () => {
  return (
    <footer className="footer">
      <p>© {new Date().getFullYear()} ironic — Built for investors</p>
    </footer>
  );
};

export default function App() {
  return (
    <div className="app">
      <Header />
      <Hero />
      <Footer />
    </div>
  );
}
